import styled from 'styled-components';

export const DetailWrapper = styled.div`
	width:50%;
	min-width:700px;
	margin: 0 auto;
	h3{
		font-size:34px;
		font-weight:bold;
		color:#333;
		line-height:1.4;
		text-align:center;
		margin:50px 0 20px;
	}
`;
export const DetailContent = styled.div`
	img{
		width:100%;
	}
	p{
		font-size:16px;
		color:#2f2f2f;
		margin-bottom: 20px;
	}
`;
